<!DOCTYPE html>
<html>
<head>
<title>Customer Portal Unit Testing Overview</title>
<style>
body { font-family:Georgia; }
h1 { font-size:6em; margin:10px; }
h2 { margin-bottom:0; border-bottom:3px solid black; }
a { text-decoration:none; font-weight:bold; color:#000 }
sub,section { display:block }
sub { margin-bottom:1em }
#title { border-bottom:20px solid #000 }
#prereq { margin-top: 10px; padding:10px; font-size:0.8em; background:rgba(226, 253, 189, 1.0); }
#prereq h2 { font-size: 1em; margin:0 0 10px 0; border-bottom:none; }
#prereq, #content { margin:10px auto; max-width:1100px; }
.code { font-family:Courier }
.action a { font-weight:normal; font-size:smaller; padding:4px 8px; text-decoration:none; border-radius:8px; }
.action a:empty { display:none }
.action a:first-child { background:#000; color:#FFF }
.action a { background:#33ba31; color:#000 }
#pietime { position:relative; margin:auto; width:50% }
#pietime h2 { position:relative; left:100px }
.pie { position:absolute; width:200px; height:200px; clip:rect(0px,100px,200px,0px); -moz-border-radius:100px; -webkit-border-radius:100px; border-radius:100px; border-top-left-radius:100px 100px; border-top-right-radius:100px 100px; border-bottom-right-radius:100px 100px; border-bottom-left-radius:100px 100px }
.slice { position:absolute; width:200px; height:200px; clip:rect(0px,200px,200px,100px); left:100px; top:60px }
#major { clip:rect(auto,auto,auto,auto); margin-left:10px; margin-top:10px }
#minor { -moz-transform:rotate(338deg); -webkit-transform:rotate(338deg); left:107px }
#minor .pie { background-color:yellow; border-color:yellow; -moz-transform:rotate(26.6deg); -webkit-transform:rotate(26.6deg) }
#major .pie { background-color:blue; border-color:blue; -moz-transform:rotate(360deg); -webkit-transform:rotate(360deg) }
.pie.fill { -moz-transform:rotate(180deg)!important; -webkit-transform:rotate(180deg)!important }
#legend { position:absolute; left:400px; top:180px }
#majorLabel { border-left:20px solid blue; margin-bottom:6px; padding-left:20px }
#minorLabel { border-left:20px solid yellow; padding-left:20px }
#dude { border-bottom:4px double #000; width:402px; margin:50px auto 100px }
#dude:hover>p { visibility:visible }
#dude p { position:relative; visibility:hidden; padding:15px; margin:1em 0; border:5px solid #000; background:white; -moz-border-radius:10px; -webkit-border-radius:10px; width:200px }
#dude p::before { content:""; display:block; position:absolute; bottom:-40px; left:40px; width:0; height:0; border:20px solid transparent; border-top-color:#000 }
#dude p::after { content:""; display:block; position:absolute; bottom:-26px; left:47px; width:0; height:0; border:13px solid transparent; border-top-color:white }
</style>
</head>
<body>
    <section id="title">
        <h1>Unit Testing</h1>
        <span>You're in the right place.</span>
    </section>
    <section id="prereq">
        <h2>❋ Prereqs</h2>All of the Customer Portal unit tests assume that they are running on a more or less unmodified copy of the code base on a working, deployed CP interface which has an unmodified copy of the standard "TPM" database which is loaded by create_test_db by default.
    </section>
    <section id="content">
        <article>
            <h2>Rendering</h2>
            <p>
            The rendering tests perform exact<a href="#renderingExact" onclick="document.getElementById('renderingExact').style.backgroundColor='yellow';"<small>①</small></a> match string comparisons. Predominantly these tests are used to ensure that widgets do not change unexpectedly. For compatibility reasons, we want our widgets to change very rarely once they have shipped.  However, these tests can be used to ensure that any aspect of the CP page rendering stack is consistent and unchanged from prior releases.
            </p>
            <p>
            The rendering tests work by searching the code base (currently the <span class="code">/cp/core/widgets/</span> and <span class="code">/cp/core/framework/views/</span> subdirectories) for files with a <span class="code">*.test</span> extension inside of a <span class="code">tests</span> subdirectory.  The <span class="code">*.test</span> files are expected to be in a <a href="http://www.yaml.org/">YAML</a>-like format which is described in the rendering test <a href="/ci/unitTest/rendering/">usage</a> information. Each of these files is converted into a CP page and then the site is deployed.            </p>
            <p>
            After being deployed, the unit test harness requests each page via HTTP.  The response is compared to the expected output contained in the <span class="code">*.test</span> file.
            </p>
            <p>
            Because these tests are based on exact text match, they tend to be relatively brittle.  I'd generally steer you toward using another type of test unless you're trying to ensure that widgets don't change or you're trying to exercise the CP rendering stack.
            </p>
            <sub><a id="renderingExact"><small>①</small> There are some filters which cause certain common sources of spurious differences to be ignored.  For example, session IDs are filtered out of the pages.  Thus, technically, it's not doing <i>exact</i> matches.</a></sub>
            <div class="action">
                <a href="/ci/unitTest/rendering/">Usage</a>
                <a href="/ci/unitTest/rendering/test">Run it &rarr;</a>
            </div>
        </article>
        <article>
            <h2>PHP Function Level</h2>
            <p>
            These are typical <i>x</i>Unit-style tests for PHP.  <a href="http://simpletest.org">SimpleTest</a> is the underlying test framework.
            </p>
            <p>
            When these unit test are run, the code base is searched for files within a <span class="code">test</span> directory having either a <span class="code">*.test.php</span> or <span class="code">*.slowtest.php</span> extension.
            Files with the <span class="code">test</span> extension should be fast running unit tests, whereas files having the <span class="code">slowtest</span> extension can be slower running integration or system type tests.
            A SimpleTest suite is created and each of these files is added as a member of the suite.  The suite is then handed to SimpleTest for execution.
            </p>
            <p>
            <li>In order to echo content during the running of a test while still keeping the content hidden when output is read, use the echoContent() function in CPTestCase.
            The output of the tests will include a link to toggle the visibility of the echo'ed content.
            </p>
            <div class="action">
                <a href="/ci/unitTest/phpFunctional/">Usage</a>
                <a href="/ci/unitTest/phpFunctional/test">Run unit tests &rarr;</a>
                <a href="/ci/unitTest/phpFunctional/testSlow">Run slow tests &rarr;</a><br /><br />
                <a href="/ci/unitTest/phpFunctional/testAll">Run all tests &rarr;</a>
            </div>
        </article>
        <article>
            <h2>JavaScript Function Level</h2>
            <p>
            These tests use the <a href="http://developer.yahoo.com/yui/yuitest/">YUI unit test framework</a> to do <i>x</i>Unit-style tests for JavaScript. It searches <span class="code">/euf/core/debug-js/tests</span> for files with the <span class="code">*.test.js</span> extension.
            </p>
            <div class="action">
                <a href="/ci/unitTest/javascript/">Usage</a>
                <a href="/ci/unitTest/javascript/">Run it &rarr;</a>
            </div>
        </article>
        <article>
            <h2>JavaScript Widget Interaction</h2>
            <p>
            The JavaScript widget interaction tests use <a href="http://developer.yahoo.com/yui/yuitest/">YUI unit test framework</a> to exercise widgets to determine whether they operate correctly. 
            <p>
            A typical assertion in this kind of test examines the DOM to determine that the correct text is displayed after simulating some kind of user action.  It also tests that correct JS events fire with the correct data in response to simulated user action.  Furthermore, it determines that the correct data is returned from the server in response to simulated user action.
            </p>
            <p>
            The pages which the widgets sit on for these tests are provided by the rendering tests.
            </p>
            <div class="action">
                <a href="/ci/unitTest/rendering/jsFunctional/showHelp">Usage</a>
                <a href="/ci/unitTest/rendering/jsFunctional/showLinks">Run it &rarr; (Please wait.)</a>
            </div>
        </article>
        <article>
            <h2>Widget Functional Level</h2>
            <p>
                These are typical <i>x</i>Unit-style tests for PHP. <a href="http://simpletest.org">SimpleTest</a> is the underlying test framework.
            </p>
            <p>
                When these unit tests are run, the code base is searched for a <span class="code">controller.test.php</span> file within a widget's <span class="code">test</span> directory.
            </p>
            <p>
                <li>In order to echo content during the running of a test while still keeping the content hidden when output is read, use the echoContent() function in CPTestCase.
                The output of the tests will include a link to toggle the visibility of the echo'ed content.
            </p>
            <div class="action">
                <a href="/ci/unitTest/widgetFunctional/index">Usage</a>
                <a href="/ci/unitTest/widgetFunctional/test">Run it &rarr;</a>
            </div>
        </article>
        <article>
            <h2>Documentation</h2>
            <p>
                The documentation unit tests ensure that our public API code comments are properly formatted and that all methods have a description and document their parameters correctly.
            </p>
            <p>
                Currently we only have tests for our PHP Documentation, which uses <a href="http://www.phpdoc.org">PHP Documentor</a>.
            </p>
            <div class="action">
                <a href="/ci/unitTest/documentation/index">Usage</a>
                <a href="/ci/unitTest/documentation/php">Run PHP Tests &rarr;</a>
            </div>
        </article>
        <article>
            <h2>Memcache Toy</h2>
            <p>
                Rather than being a proper automated unit test, this page simply allows you to get, set, and delete values in Memcache. Its primary purpose to provide a UI to allow you to poke at Memcache to ensure that the layers RightNow has built around it are working correctly and that your site is correctly configured to talk to the Memcache server(s).
            </p>
            <div class="action">
                <a href="#"></a>
                <a href="/ci/unitTest/memcacheTester">Run it &rarr;</a>
            </div>
        </article>
    </section>
    <div id="dude">
        <p>And remember, kids...</p>
        <img src="data:image/png;base64,">
    </div>
    <section id="pietime">
        <h2>When is it OK to code without tests?</h2>
        <div id="major" class="slice">
            <div class="pie"></div>
            <div class="pie fill"></div>
        </div>
        <div id="minor" class="slice">
            <div class="pie"></div>
        </div>
        <div id="legend">
            <div id="majorLabel">
                Not OK
            </div>
            <div id="minorLabel">
                Still Not OK
            </div>
        </div>
    </section>
</body>
</html>
